        [Fact]
        public void ScriptFileName_ReturnsCorrectString()
        {
            //Arrange
            System.Threading.Thread.CurrentThread.CurrentCulture = CultureInfo.InvariantCulture;
            LinearRegressionAnalysisModel sut = new LinearRegressionAnalysisModel();

            //Act
            string result = sut.ScriptFileName;

            //Assert
            Assert.Equal("LinearRegressionAnalysis", result);
        }

        [Fact]
        public void TransformationsList_ReturnsCorrectList()
        {
            //Arrange
            System.Threading.Thread.CurrentThread.CurrentCulture = CultureInfo.InvariantCulture;
            LinearRegressionAnalysisModel sut = new LinearRegressionAnalysisModel();

            //Act
            IEnumerable<string> result = sut.TransformationsList;

            //Assert
            Assert.IsAssignableFrom<IEnumerable<string>>(result);
            Assert.Equal(new List<string>() { "None", "Log10", "Loge", "Square Root", "ArcSine", "Rank" }, result);
        }

        [Fact]
        public void SignificancesList_ReturnsCorrectList()
        {
            //Arrange
            System.Threading.Thread.CurrentThread.CurrentCulture = CultureInfo.InvariantCulture;
            LinearRegressionAnalysisModel sut = new LinearRegressionAnalysisModel();

            //Act
            IEnumerable<string> result = sut.SignificancesList;

            //Assert
            Assert.IsAssignableFrom<IEnumerable<string>>(result);
            Assert.Equal(new List<string>() { "0.1", "0.05", "0.025", "0.01", "0.001" }, result);
        }

        [Fact]
        public void ExportData_ReturnsCorrectStringArray()
        {
            //Arrange
            System.Threading.Thread.CurrentThread.CurrentCulture = CultureInfo.InvariantCulture;
            Mock<IDataset> mockDataset = new Mock<IDataset>();
            mockDataset.Setup(x => x.DatasetID).Returns(1);
            mockDataset.Setup(x => x.DatasetToDataTable()).Returns(GetTestDataTable());

            LinearRegressionAnalysisModel sut = GetModel(mockDataset.Object);

            //Act
            string[] result = sut.ExportData();

            //Assert
            Assert.Equal("Response1,Cont1,Cat1,Block1,Covariate", result[0]);
            Assert.Equal(145, result.Count()); //as blank reponses are removed
            Assert.StartsWith("0.991702474728814,0.974032833008224", result[32]);
        }

        [Fact]
        public void GetArguments_ReturnsCorrectArguments()
        {
            //Arrange
            System.Threading.Thread.CurrentThread.CurrentCulture = CultureInfo.InvariantCulture;
            LinearRegressionAnalysisModel sut = GetModel(GetDataset());

            //Act
            List<Argument> result = sut.GetArguments().ToList();

            //Assert
            var response = result.Single(x => x.Name == "Response");
            Assert.Equal("Response1", response.Value);

            var categoricalFactors = result.Single(x => x.Name == "CategoricalFactors");
            Assert.Equal("Cat1", categoricalFactors.Value);

            var coefficients = result.Single(x => x.Name == "Coefficients");
            Assert.Equal("True", coefficients.Value);

            var continuousFactors = result.Single(x => x.Name == "ContinuousFactors");
            Assert.Equal("Cont1", continuousFactors.Value);

            var continuousFactorsTransformation = result.Single(x => x.Name == "ContinuousFactorsTransformation");
            Assert.Equal("None", continuousFactorsTransformation.Value);

            var cooksDistancePlot = result.Single(x => x.Name == "CooksDistancePlot");
            Assert.Equal("False", cooksDistancePlot.Value);

            var covariates = result.Single(x => x.Name == "Covariates");
            Assert.Equal("Covariate", covariates.Value);

            var responseTransformation = result.Single(x => x.Name == "ResponseTransformation");
            Assert.Equal("None", responseTransformation.Value);

            var covariateTransformation = result.Single(x => x.Name == "CovariateTransformation");
            Assert.Equal("None", covariateTransformation.Value);

            var leveragePlot = result.Single(x => x.Name == "LeveragePlot");
            Assert.Equal("False", leveragePlot.Value);

            var primaryFactor = result.Single(x => x.Name == "PrimaryFactor");
            Assert.Equal("Cat1", primaryFactor.Value);

            var otherDesignFactors = result.Single(x => x.Name == "OtherDesignFactors");
            Assert.Equal("Block1", otherDesignFactors.Value);

            var anovaSelected = result.Single(x => x.Name == "ANOVASelected");
            Assert.Equal("True", anovaSelected.Value);

            var adjustedRSquared = result.Single(x => x.Name == "AdjustedRSquared");
            Assert.Equal("False", adjustedRSquared.Value);

            var significance = result.Single(x => x.Name == "Significance");
            Assert.Equal("0.05", significance.Value);

            var normalProbabilityPlot = result.Single(x => x.Name == "NormalProbabilityPlot");
            Assert.Equal("False", normalProbabilityPlot.Value);

            var residualsVsPredictedPlot = result.Single(x => x.Name == "ResidualsVsPredictedPlot");
            Assert.Equal("False", residualsVsPredictedPlot.Value);
        }

        [Fact]
        public void LoadArguments_ReturnsCorrectArguments()
        {
            //Arrange
            System.Threading.Thread.CurrentThread.CurrentCulture = CultureInfo.InvariantCulture;
            LinearRegressionAnalysisModel sut = new LinearRegressionAnalysisModel(GetDataset());

            List<Argument> arguments = new List<Argument>();
            arguments.Add(new Argument { Name = "Response", Value = "Response1" });
            arguments.Add(new Argument { Name = "AdjustedRSquared", Value = "False" });
            arguments.Add(new Argument { Name = "CategoricalFactors", Value = "Cat1" });
            arguments.Add(new Argument { Name = "Coefficients", Value = "True" });
            arguments.Add(new Argument { Name = "ContinuousFactors", Value = "Cont1" });
            arguments.Add(new Argument { Name = "ContinuousFactorsTransformation", Value = "None" });
            arguments.Add(new Argument { Name = "CooksDistancePlot", Value = "False" });
            arguments.Add(new Argument { Name = "CovariateTransformation", Value = "None" });
            arguments.Add(new Argument { Name = "Covariates", Value = "Covariate" });
            arguments.Add(new Argument { Name = "LeveragePlot", Value = "False" });
            arguments.Add(new Argument { Name = "NormalProbabilityPlot", Value = "False" });
            arguments.Add(new Argument { Name = "OtherDesignFactors", Value = "Block1" });
            arguments.Add(new Argument { Name = "ResponseTransformation", Value = "None" });
            arguments.Add(new Argument { Name = "PrimaryFactor", Value = "Cat1" });
            arguments.Add(new Argument { Name = "ANOVASelected", Value = "True" });
            arguments.Add(new Argument { Name = "ResidualsVsPredictedPlot", Value = "False" });
            arguments.Add(new Argument { Name = "Significance", Value = "0.05" });

            Assert.Equal(17, arguments.Count);

            //Act
            sut.LoadArguments(arguments);

            //Assert
            Assert.Equal("Response1", sut.Response);
            Assert.False(sut.AdjustedRSquared);
            Assert.Equal(new List<string> { "Cat1" }, sut.CategoricalFactors);
            Assert.True(sut.Coefficients);
            Assert.Equal(new List<string> { "Cont1" }, sut.ContinuousFactors);
            Assert.Equal("None", sut.ContinuousFactorsTransformation);
            Assert.False(sut.CooksDistancePlot);
            Assert.Equal("None", sut.CovariateTransformation);
            Assert.Equal(new List<string> { "Covariate" }, sut.Covariates);
            Assert.False(sut.LeveragePlot);
            Assert.False(sut.NormalProbabilityPlot);
            Assert.Equal(new List<string> { "Block1" }, sut.OtherDesignFactors);
            Assert.Equal("None", sut.ResponseTransformation);
            Assert.Equal("Cat1", sut.PrimaryFactor);
            Assert.True(sut.ANOVASelected);
            Assert.False(sut.ResidualsVsPredictedPlot);
            Assert.Equal("0.05", sut.Significance);
        }


        [Fact]
        public void GetCommandLineArguments_ReturnsCorrectString()
        {
            //Arrange
            System.Threading.Thread.CurrentThread.CurrentCulture = CultureInfo.InvariantCulture;
            LinearRegressionAnalysisModel sut = GetModel(GetDataset());

            //Act
            string result = sut.GetCommandLineArguments();

            //Assert
            Assert.Equal("Response1~Cat1+Block1 Covariate None None Cat1 Cat1 Cont1 None Block1 Y Y N 0.05 N N N N", result);
        }


        private LinearRegressionAnalysisModel GetModel(IDataset dataset)
        {
            var model = new LinearRegressionAnalysisModel(dataset)
            {
                ANOVASelected = true,
                AdjustedRSquared = false,

                CategoricalFactors = new List<string>
                {
                    "Cat1"
                },
                Coefficients = true,
                ContinuousFactors = new List<string>
                {
                    "Cont1"
                },
                ContinuousFactorsTransformation = "None",
                CooksDistancePlot = false,
                CovariateTransformation = "None",
                Covariates = new List<string>
                {
                    "Covariate"
                },
                LeveragePlot = false,
                NormalProbabilityPlot = false,
                OtherDesignFactors = new System.Collections.Generic.List<string>
                {
                    "Block1"
                },
                PrimaryFactor = "Cat1",
                ResidualsVsPredictedPlot = false,
                Response = "Response1",
                ResponseTransformation = "None",
                Significance = "0.05"
            };

            return model;
        }

